import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import styled from "styled-components";

export default function ImageSlider() {
  let Setting = {
    dot: true,
    autoplay: true,
    infinite: true,
    speed: 500,
    slideToShow: 1,
    slideToScroll: 1,
  };

  return (
    <div>
      <Carousel {...Setting}>
        <Wrap>
          <a>
            <img src="/Images/bacgroundImg(1).jpg" alt="MyHospitalWebsite" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/Images/bacgroundImg(2).jpg" alt="MyHospitalWebsite" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/Images/bacgroundImg(3).jpg" alt="MyHospitalWebsite" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/Images/bacgroundImg(4).jpg" alt="MyHospitalWebsite" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="public\Images\bacgroundImg(5).jpg" alt="MyHospitalWebsite" />
          </a>
        </Wrap>
      </Carousel>
    </div>
  );
}


const Carousel=styled(Slider)`
    background-color: aqua;
    border: 2px solid green;
    margin-top:40px;
`

const Wrap=styled.div`

`
